$(function(){ //--> START FUNCTIONS ON LOAD DOM 

 ////////////////////////////////////////////////////--> livequery for date and time
   $(".data,.datemmddyyyy,.dateddmmyyyy").livequery(function(){$(this).mask("99/99/9999") });
   $(".ora").livequery(function(){$(this).mask("99:99") });

 ////////////////////////////////////////////////////--> TOOLTIP ON TITLE ATRIBUTE
   $('*[title]').livequery(function(){
   $(this).qtip({
       position: {
		my: 'bottom center',
		at: 'top center',
		viewport: $(window)
	   },
	   style: {
		classes: 'ui-tooltip-dark ui-tooltip-shadow ui-tooltip-tipsy'
	   }	   
    })
   }); 
          
 ////////////////////////////////////////////////////--> SET SOME STANDARD CUFON FONTS
 var font1 = function(){
  Cufon.replace($(this), { fontFamily: 'Script MT Bold'});
 }
 $('.font1').livequery(font1);  

//////////////////////////////////////////--> BUTTON BARR LIKE FLEXIGRID
var buttons_bar = function(){
  $(this).find('span').each(function(){
    $('<div class="obj_separator"></div>').insertAfter($(this));
    $(this).wrap('<div class="obj_button"/>').wrap('<div/>');
    var classe_span = $(this).attr('class');
    $(this).removeAttr('class').find('img').css({'margin-right':'3px','margin-left':'-2px','margin-top':'-2px','width':'16px','height':'16px','vertical-align':'middle'});
    $(this).closest('.obj_button').addClass(classe_span);    
  });
}
$('.buttons_barr').livequery(buttons_bar); 
 
 /////////////////////////////////////////--> STYLE OF BUTTON AND RADIO BUTTON WITH JQUERY UI (BUTTON)
var buttonizza_check = function(){
  if($(this).is(':checked')){
   $(this).button({
            icons: {
                primary: 'ui-icon-check'
            }    
   });
  }else{
   $(this).button();
  }
      $(this).click(function(){
        $(this).button("destroy");
        if($(this).is(':checked')){      
          $(this).button({
            icons: {
                primary: 'ui-icon-check'
            }      
          });
        }else{
          $(this).button();
        }
      });  
 }
 
var buttonizza_radio = function(){
  var $this = $(this);
  $this.find('.default_check').prop('checked',true).click();
  $this.buttonset();
  $this.find('input:radio').button({
            icons: {
                primary: 'ui-icon-radio-off'
            }   
  });      
      $this.find('input:radio').click(function(){
        $(this).closest('.group_radio').find('input:radio').button({
            icons: {
                primary: 'ui-icon-radio-off'
            }         
        });
        $(this).button({
            icons: {
                primary: 'ui-icon-bullet'
            }        
        });
      }); 
      $this.find('.default_check').prop('checked',true).click();        
 } 
$('.buttonizza').livequery(buttonizza_check);
$('.group_radio').livequery(buttonizza_radio);

 /////////////////////////////////////////--> REMOVE AUTOCOMPLETE ATRIBUTE
 var autocomplete_off = function(){
  $(this).attr('autocomplete','off');
 }
 $('input:text,textarea').livequery(autocomplete_off); 

 ////////////////////////////////////////--> HIGHLIGHT A SELECTOR WITH "OVER_STATE CLASS
 var over_state = function(){
  $(this).hover(function(){
   $(this).toggleClass('highlight');
  });
 }
 $('.over_state').livequery(over_state);  

 /////////////////////////////////--> CONVERT , -> . FOR NUMERIC FIELDS
 $('.number').livequery(function(){$(this).addClass('no_space')}); /***** THE "NUMBER" CLASS NOT ACCEPR SPACES *******/
 $('body').delegate('.number','keyup',function(){
  if($(this).val().indexOf(',')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/\,/g,'.'));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }
 });  
 /////////////////////////////////--> CONVERT NAME OF FILE DELETING SPECIAL CAR (<,>,\,/,",:,*,|) --> FOR CORRECT UPLOAD FILES
 $('body').delegate('.filesystem','keyup',function(){
  if($(this).val().indexOf('<')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/</g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }
  if($(this).val().indexOf('>')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/>/g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }  
  if($(this).val().indexOf('\\')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/\\/g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }  
  if($(this).val().indexOf('/')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/\//g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }
  if($(this).val().indexOf('"')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/\"/g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }     
  if($(this).val().indexOf(':')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/:/g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }  
  if($(this).val().indexOf('*')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/\*/g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }  
  if($(this).val().indexOf('|')>-1){
     var cur_pos = $(this).getCursorPosition();
     $(this).val($(this).val().replace(/\|/g,''));
     $(this).resetCursorPosition(cur_pos,cur_pos);
  }  
 });  
 //////////////////////////////////--> REPLACE BLANCK SPACE DURING TYPING
 $('body').delegate('.no_space','keyup',function(){
  if($(this).val().indexOf(' ')>-1){
     var cur_pos = $(this).getCursorPosition()-1;
     $(this).val($(this).val().replace(/ /g,"").replace(/\s+/g,""));     
     $(this).resetCursorPosition(cur_pos,cur_pos);
  } 
 }); 
$.ajaxSetup({
  cache: false
});
});//////////////////////////////-> CLOSE FUNCTION



